Daniela Laguna Ortega, alumna de bachillerato de Artes del Colegio Nuryana, en Tenerife, ha sido premiada en la decimotercera edición del Concurso Nacional de Dibujo sobre los Derechos Humanos convocado por la institución El Defensor del Pueblo, con la colaboración de la ONG Globalización de los Derechos Humanos. El objetivo del concurso, que premia a seis trabajos de toda España entre todos los niveles educativos, es promover el conocimiento de los derechos humanos entre los escolares españoles
..........
, bachillerato y ciclos formativos de Grado Medio). El jurado, que también puede conceder las menciones honoríficas que considere oportunas o declarar desierto cualquiera de los premios, está presidido por la Defensora del Pueblo, e integrado por destacadas personalidades del mundo cultural y artístico. En esta edición, además de la Defensora del Pueblo, lo han integrado la artista Bárbara Allende Ouka Leele; la médico y coleccionista de arte contemporáneo Pilar Citoler; el pintor Hernán Cortés;

Doble candidatura para Tania Palacios Nos cuentan que Tania Palacios Kuri marcó un doblete, tal como se dice en el lenguaje futbolero. Además de haber sido postulada en febrero pasado como candidata del PAN a diputada local por el tercer distrito, la ex secretaria de la Juventud también será incluida en la lista de los pluris. Estará en el segundo lugar. Quienes también forman parte de esta lista, nos cuentan, son el ex dirigente estatal de Acción Nacional José Luis Báez, que va en primer lugar;
..........
partido a la presidencia municipal de Querétaro, Luis Bernardo Nava, en su planilla de regidores, es la de Miguel Parrodi Espinosa, hijo de la ex diputada federal panista Patricia Espinosa Torres, quien actualmente es una de las colaboradoras más cercanas de la candidata presidencial independiente, Margarita Zavala. Inician registros de candidatos priístas Nos comentan que los registros de los candidatos del PRI a las presidencias municipales más importantes de la entidad iniciarán hoy. Mario Ca
